    private WrDataGrid<Contact> _grid;
    private List<Contact> _list;
    
    [Parameter] public string Id { get; set; } 
    [Parameter] public string ThisDir { get; set; }="Dir";  
    [Parameter] public string ThisSubDir { get; set; }="Contact";
    [Parameter] public string ThisPage { get; set; }="ViewStd"; 
    [Parameter] public string UniqIdOfRecord { get; set; }="Id";  
